import HomePageFirst from '../components/HomeSlides/HomePageFirst';
import HomePageSecond from '../components/HomeSlides/HomePageSecond';
import Footer from '../components/Footer/Footer';

import './Home.css';

function Home()
{
    return(
        <div id = 'home-page-wrapper'>
            <HomePageFirst />
            <HomePageSecond />
            <Footer />
        </div>
    )
}

export default Home
